import * as React from 'react';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { MuiThemeMod } from './MuiThemeMod';
import Navbar from './components/layout/Navbar'; // Corrigindo a importação do Navbar
import Footer from './components/layout/Footer'; // Corrigindo a importação do Footer

export default function App() {
  const theme = createTheme(MuiThemeMod);

  return (
    <ThemeProvider theme={theme}>
      <Navbar />
      <Footer />
    </ThemeProvider>
  );
}
